import React from 'react';
import './header.css';
import SearchIcon from '@material-ui/icons/Search';
import HomeIcon from '@material-ui/icons/Home';
import GroupIcon from '@material-ui/icons/Group';
import OndemandVideoIcon from '@material-ui/icons/OndemandVideo';
import GroupAddIcon from '@material-ui/icons/GroupAdd';
import AccountCircleIcon from '@material-ui/icons/AccountCircle';
import ExpandMoreIcon from '@material-ui/icons/ExpandMore';
import NotificationsIcon from '@material-ui/icons/Notifications';

function Header() {
  return (
    <div className='header'>
      {/* logo & Src Start */}
      <div className='logo__src'>
        {/* logo */}
        <img
          src='https://facebookbrand.com/wp-content/uploads/2019/10/flogo_RGB_HEX-BRC-Site-250.png?w=250&h=250'
          alt='Logo'
        />
        {/* src */}
        <div className='src'>
          <SearchIcon />
          <input type='text' placeholder='Search Facebook' />
        </div>
      </div>
      {/* logo & Src End */}
      {/* Middle Icon Start*/}
      <div className='middle__icon'>
        <div className='header_option--active'>
          <HomeIcon fontSize='large' />
        </div>
        <div className='header_option'>
          <GroupIcon fontSize='large' />
        </div>
        <div className='header_option'>
          <OndemandVideoIcon fontSize='large' />
        </div>
        <div className='header_option'>
          <GroupAddIcon fontSize='large' />
        </div>
      </div>
      {/* Middle Icon End*/}
      {/* Profile&Notification Start*/}
      <div className='Profile__Notification'>
        {/* Profile & Name */}
        <div className='profile__name'>
          <AccountCircleIcon />
          <h1>Ritam Rahman</h1>
        </div>
        {/* Notification & more */}
        <div className='notification__more'>
          <NotificationsIcon />
          <ExpandMoreIcon />
        </div>
      </div>
      {/* Profile&Notification End*/}
    </div>
  );
}

export default Header;
